content:
신개념 단기 어학연수법이네 ㅋ
아는 동생이 외국서 살다가 교통사고를 내서 5개월 구치소에서 있다가 나왔는데 현지어 완벽하게 습득했다는 사실 ㅋ
극단적인 방법이긴하지만 고립된 환경이야말로 단기어학연수의 최고의 방법인듯...^^;;

개오반데;;;;;;
다음웹툼 댓글 첨쓰는데
이거 연재하셔야 되요 작가님......

앗 작가님! 드디어!!!!!!! 연재 시작하셨네요! 축하드립니다! 
엄지곰 너무 귀여워요~&gt;ㅁ&lt; 
매주 챙겨보겠습니다! 파이팅!!!!!!!!!!!!!!!!!!^^

아놔...그와중에 아부지 명언..
&quot;남자는 원래 계획같은거 없어.&quot;
....진짜?..진짜로 그래요?....

우와.. 스크롤 끊기지 않고 채색 돼있어서 감동이었어요 ㅠㅠ 예뻐라.. 저만 이런거 감동하냐요 ㅎㅎ;;
세하랑 아빠랑 둘이 꽃위에 있는 모습 너무 예뻐요!!!
아빠랑 딸의 활약이 기대되네요 ㅋㅋ

아 진짜ㅠㅠㅠ 이렇게 짠하기 있기없기ㅠㅠㅠ
쿠비 너무 잘생겨졌어요&gt;&lt;
작가님 그동안 너무 수고 많으셨습니다. 그동안 정말 아름다운 동화 들려주셔서 정말 감사했어요. 쿠비 보면서 오랜만에 다시 어린 시절로 돌아간 것 같았습니다. 다음 작품도 기대하겠습니다:)

동화책 읽는듯한 기분이 드는 웹툰이여서 매주 일요일을 기달려왔는데 마지막이라뇨ㅜㅜㅜㅜㅜㅜㅜ 아쉽지만
그동안 재미있게 잘 보고 있었습니당&gt;_&lt;

작가님 완결 축하드려요!!!
